import React from 'react';
import './Projects.css';

function Projects() {
  return (
    <div className="projects-container">
      <h2>/ pet projects</h2>
      <div className="project">
        <h3>Tall Tales</h3>
        <p>A multiplayer collaborative storytelling game developed using React, Node.js, and Socket.io.</p>
      </div>
    </div>
  );
}

export default Projects;
